import React, { useState } from 'react';

import { QuantitySelector } from "./components/QuantitySelector"

import { megapack, megapack_2, megapack_xl, powerpack } from './assets'; 

import './App.css';

const data = [{
  name: "MegapackXL",
  cost: "$120,000",
  energy: "4 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
}, {
  name: "Megapack2",
  cost: "$80,000",
  energy: "3 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
{
  name: "Megapack",
  cost: "$50,000",
  energy: "2 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
{
  name: "Powerpack",
  cost: "$10,000",
  energy: "1 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
{
  name: "Transformer",
  cost: "$10,000",
  energy: "-0.5 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
]


const DraggableItem = ({ item, index, onDragStart, onDragOver, onDrop, onDrag }) => {
  return (
    <div
      draggable
      onDragStart={(e) => onDragStart(e, index)}
      onDragOver={(e) => onDragOver(e)}
      onDrop={(e) => onDrop(e, index)}
      onDrag={(e) => onDrag(e)}
      style={{
        padding: '8px',
        margin: '4px 0',
        border: '1px solid #ccc',
        background: '#fff',
        cursor: 'move',
        position: 'absolute', // Ensure positioning is absolute for X-axis movement
        left: item.x, // Use state or props to set X-axis position
        top: item.y, // Use state or props to set Y-axis position
        transition: 'left 0.2s ease, top 0.2s ease',
      }}
    >
      {item.content}
    </div>
  );
};

const DragDropList = () => {
  const [items, setItems] = useState(
    [
      { id: 'item-1', content: 'Item 1', x: 0, y: 0 },
      { id: 'item-2', content: 'Item 2', x: 100, y: 0 },
      { id: 'item-3', content: 'Item 3', x: 200, y: 0 },
    ]
  );

  const [draggedItemIndex, setDraggedItemIndex] = useState(null);

  const handleDragStart = (e, index) => {
    setDraggedItemIndex(index);
    e.dataTransfer.setData('text/plain', ''); // Required for drag events
  };

  const handleDragOver = (e) => {
    e.preventDefault();
  };

  const handleDrag = (e) => {
    // Update item position based on drag events
    const x = e.clientX - e.target.clientWidth / 2;
    const y = e.clientY - e.target.clientHeight / 2;

    // Update the item position in the state
    if (draggedItemIndex !== null) {
      setItems(prevItems => {
        const updatedItems = [...prevItems];
        updatedItems[draggedItemIndex] = { ...updatedItems[draggedItemIndex], x, y };
        return updatedItems;
      });
    }
  };

  const handleDrop = (e, dropIndex) => {
    e.preventDefault();

    const x = e.clientX - e.target.clientWidth / 2;
    const y = e.clientY - e.target.clientHeight / 2;

    const updatedItems = [...items];
    const draggedItem = updatedItems[draggedItemIndex];

    // Update position
    updatedItems[draggedItemIndex] = { ...draggedItem, x, y };

    // Reset the dragged item index
    setItems(updatedItems);
    setDraggedItemIndex(null);
  };

  return (
    <div style={{ position: 'relative', width: '500px', height: '500px', border: '1px solid #ccc' }}>
      {items.map((item, index) => (
        <DraggableItem
          key={item.id}
          item={item}
          index={index}
          onDragStart={handleDragStart}
          onDragOver={handleDragOver}
          onDrop={handleDrop}
          onDrag={handleDrag}
        />
      ))}
    </div>
  );
};

function App() {
  console.log("hirtd")

  // const [list1, setList1] = useState(['Item 1', 'Item 2', 'Item 3']);
  // const [list2, setList2] = useState(['Item 4', 'Item 5']);

  // const handleDropInList1 = (item) => {
  //   setList1([...list1, item]);
  //   setList2(list2.filter((i) => i !== item));
  // };

  // const handleDropInList2 = (item) => {
  //   setList2([...list2, item]);
  //   setList1(list1.filter((i) => i !== item));
  // };


  return (
    <div className="App">
      <h1>Battery Configurator</h1>
      <div className="dashboard">
      <table className="table">
        <thead>
          <tr>
            <th>Battery Type</th>
            <th>Cost/Unit</th>
            <th>Energy/Unit</th>
            <th>Quantity</th>
            <th>Total Cost</th>
            <th>Total Energy</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.name}
              {/* <img src={megapack_xl} alt="Description of the image" /> */}
              </td>
              <td>{item.cost}</td>
              <td>{item.energy}</td>
              <td>{<div className="quantity-selector">
              <input aria-label="quantity count" max="1000" min="0" type="number" value={2}/>
            </div>}</td>
              <td>{item.totalCost}</td>
              <td>{item.totalEnergy}</td>
            </tr>
          ))}
        </tbody>
      </table>
      </div>
      <div>
      <DragDropList/>
      </div>
      {/* <QuantitySelector /> */}
    </div>
  );
}

export default App;
